con:config.script:
import se.skl.rivta.testsupport.soapui.datasource.XmlDataReader
import com.eviware.soapui.support.GroovyUtils

def utils = new GroovyUtils(context)
def dataFile = new File(utils.projectPath + "/data.xml")
def source = new XmlDataReader(context, dataFile)

source.load("general test data")

def caseNamePatternsToDisable = []

//Get the project object
def project = context.testCase.testSuite.project

if ('false' == testRunner.testCase.testSuite.getPropertyValue("target_supports_RESR1")){
	caseNamePatternsToDisable << "PRE"
	caseNamePatternsToDisable << "financial_patientfees_exemption"
}

project.testSuiteList.each { suite ->
		log.info(suite.name.getClass())
		suite.disabled = caseNamePatternsToDisable.any { suite.name.contains(it) }
}

